import { StartScene } from '../../../branded_games/scenes/start_scene';
import { GameScene } from '../../../branded_games/scenes/game_scene';
import { EndCardScene } from '../../../branded_games/scenes/end_card_scene';
import { ShareScene } from '../../../branded_games/scenes/share_scene';
import { PrizeScene } from '../../../branded_games/scenes/prize_scene';
import { AssetLibrary, AssetTypes } from './asset_library';

export enum Scenes {
  NONE = 'NONE',
  LOADING = 'LOADING',
  START = 'START',
  GAME = 'GAME',
  ENDCARD = 'ENDCARD',
  SHARE = 'SHARE',
  PRIZE = 'PRIZE'
}

export class SceneManager {
  public initialized = false;

  public assetLib: AssetLibrary = new AssetLibrary();
  public currentScene: Scenes = Scenes.NONE;

  private theJSON: Blob = new Blob();

  constructor() {
    this.AsyncInit();
  }

  private async AsyncInit() {
    //this.assetLib = new AssetLibrary();

    this.theJSON = await this.assetLib.GetAssetFromServer('assets.json', AssetTypes.JSON).then(function(result: any) {
      if (result == null) {
        console.error('Tried to load an image that does not exist.');
      } else {
        return result;
      }
    });

    this.LoadScene(Scenes.LOADING);

    this.initialized = true;
  }

  private GetSceneData(scene: Scenes, json: any) {
    var active: boolean = false;
    var sceneTextures: any;
    var sceneObjects: any;
    var sceneAudio: any;

    Object.keys(json).map(function(sceneNamedIndex) {
      if (scene == sceneNamedIndex) {
        Object.keys(json[sceneNamedIndex]).map(function(assetType) {
          switch (assetType) {
            case 'active':
              active = json[sceneNamedIndex][assetType];
              break;
            case 'Textures':
              sceneTextures = Object.keys(json[sceneNamedIndex][assetType]).map(function(textureName) {
                return json[sceneNamedIndex][assetType][textureName];
              });
              break;
            case 'Objects':
              sceneObjects = Object.keys(json[sceneNamedIndex][assetType]).map(function(objectName) {
                return json[sceneNamedIndex][assetType][objectName];
              });
              break;
            case 'Audio':
              sceneAudio = Object.keys(json[sceneNamedIndex][assetType]).map(function(audioName) {
                return json[sceneNamedIndex][assetType][audioName];
              });
              break;
            default:
              break;
          }
        });
      }
    });

    return { name: scene, active: active, assets: { texturesToLoad: sceneTextures, objectsToLoad: sceneObjects, audioToLoad: sceneAudio } };
  }

  public async LoadScene(scene: Scenes) {
    var toLoad = this.GetSceneData(scene, this.theJSON).assets;

    for (var q = 0; q < toLoad.texturesToLoad.length; q++) {
      this.assetLib.LoadTexture(toLoad.texturesToLoad[q]);
    }
    for (var q = 0; q < toLoad.objectsToLoad.length; q++) {
      this.assetLib.LoadObject(toLoad.objectsToLoad[q]);
    }
    for (var q = 0; q < toLoad.audioToLoad.length; q++) {
      this.assetLib.LoadAudio(toLoad.audioToLoad[q]);
    }
  }

  public SceneLoaded(scene: Scenes) {
    var checkLoad = this.GetSceneData(scene, this.theJSON).assets;

    if (this.assetLib.TexturesLoaded(checkLoad.texturesToLoad) && this.assetLib.ObjectsLoaded(checkLoad.objectsToLoad) && this.assetLib.AudioLoaded(checkLoad.audioToLoad)) {
      return true;
    } else {
      return false;
    }
  }

  public SceneActive(scene: Scenes): boolean {
    return this.GetSceneData(scene, this.theJSON).active;
  }

  public GoToPreviousScene(currentScene: any) {
    switch (currentScene) {
      case 'START':
        break;
      case 'GAME':
        new StartScene(this);
        break;
      case 'ENDCARD':
        new GameScene(this);
        break;
      case 'SHARE':
        if (!this.SceneActive(Scenes.ENDCARD)) {
          this.GoToPreviousScene(Scenes.ENDCARD);
        }
        new EndCardScene(this);
        break;
      case 'PRIZE':
        if (!this.SceneActive(Scenes.SHARE)) {
          this.GoToPreviousScene(Scenes.SHARE);
        }
        new ShareScene(this);
        break;
    }
  }

  public GoToNextScene(currentScene: any) {
    switch (currentScene) {
      case 'LOADING':
        if (!this.SceneActive(Scenes.START)) {
          this.GoToNextScene(Scenes.START);
          break;
        }
        new StartScene(this);
        break;
      case 'START':
        new GameScene(this);
        break;
      case 'GAME':
        if (!this.SceneActive(Scenes.ENDCARD)) {
          this.GoToNextScene(Scenes.ENDCARD);
          break;
        }
        new EndCardScene(this);
        break;
      case 'ENDCARD':
        if (!this.SceneActive(Scenes.SHARE)) {
          this.GoToNextScene(Scenes.SHARE);
        }
        new ShareScene(this);
        break;
      case 'SHARE':
        if (!this.SceneActive(Scenes.PRIZE)) {
          this.GoToNextScene(Scenes.PRIZE);
        }
        new PrizeScene(this);
        break;
      default:
        break;
    }
  }
}
